// src/pages/MyProducts.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const MyProducts = ({ user }) => {
    const [products, setProducts] = useState([]);
    const [form, setForm] = useState({
        price: '',
        category: '',
        location: '',
        quantity: '',
        shippingOptions: 'STANDARD',
        description: ''
    });

    const fetchProducts = async () => {
        const res = await axios.get(`http://localhost:5000/api/products/user/${user.username}`);
        setProducts(res.data);
    };

    useEffect(() => {
        fetchProducts();
    }, []);

    const handleChange = e => setForm({ ...form, [e.target.name]: e.target.value });

    const handleSubmit = async e => {
        e.preventDefault();
        try {
            await axios.post('http://localhost:5000/api/products', { ...form, offeredBy: user.username });
            setForm({
                price: '',
                category: '',
                location: '',
                quantity: '',
                shippingOptions: 'STANDARD',
                description: ''
            });
            fetchProducts();
        } catch(err) {
            console.log(err);
        }
    };

    return (
        <div>
            <h2 className="text-xl mb-4">My Products</h2>
            <form onSubmit={handleSubmit} className="mb-6">
                <div className="flex flex-col space-y-2">
                    <input type="number" name="price" placeholder="Price (ETH)" value={form.price} onChange={handleChange} required className="p-2 border rounded" />
                    <input type="text" name="category" placeholder="Category" value={form.category} onChange={handleChange} required className="p-2 border rounded" />
                    <input type="text" name="location" placeholder="Location" value={form.location} onChange={handleChange} required className="p-2 border rounded" />
                    <input type="number" name="quantity" placeholder="Quantity" value={form.quantity} onChange={handleChange} required className="p-2 border rounded" />
                    <select name="shippingOptions" value={form.shippingOptions} onChange={handleChange} className="p-2 border rounded">
                        <option value="STANDARD">Standard</option>
                        <option value="EXPRESS">Express</option>
                        <option value="PICKUP">Pickup</option>
                    </select>
                    <textarea name="description" placeholder="Description" value={form.description} onChange={handleChange} className="p-2 border rounded"></textarea>
                    <button type="submit" className="bg-green-500 text-white p-2 rounded">Add Product</button>
                </div>
            </form>
            <div>
                <h3 className="text-lg mb-2">Your Products:</h3>
                {products.length === 0 ? <p>No products added yet.</p> :
                    <ul className="space-y-2">
                        {products.map(product => (
                            <li key={product._id} className="p-2 border rounded">
                                <p><strong>Price:</strong> {product.price} ETH</p>
                                <p><strong>Category:</strong> {product.category}</p>
                                <p><strong>Location:</strong> {product.location}</p>
                                <p><strong>Quantity:</strong> {product.quantity}</p>
                                <p><strong>Shipping:</strong> {product.shippingOptions}</p>
                                <p><strong>Description:</strong> {product.description}</p>
                            </li>
                        ))}
                    </ul>
                }
            </div>
        </div>
    );
};

export default MyProducts;
